import React, { Component } from 'react';

export default class VehicleDetailsForm extends Component{
    render(){
        return(
            <div>
                <h2>Vehichle Details Page</h2>
                <form onSubmit={this.props.onSubmit}>
                    <label>Vin: </label>
                    <input type="text" name="VIN" onChange={this.props.onChange}/>
                    <label>Mileage: </label>
                    <input type="text" name="mileage" onChange={this.props.onChange}/>
                    <input type="submit" value="Submit"/>
                </form>
            </div>
        );
    }
}
